import Foto from '../static/FotoLuisBrito.jpg';
const PersonalData = () => (
    <div className="container">

            <div className="image">
                <img  src={Foto}></img>
            </div>

            <div className="datos">
                <h1>Datos Personales</h1>
                <ul>
                    <li>Nombre: Luis Manuel</li>
                    <li>Apellido: Brito Romero</li>
                    <li>Telefono: +58 414 092.96.37</li>
                    <li>Direccion: Charallave -Edo. Miranda</li>
                    <li>Email: lsbrt4@gmail.com</li>
                </ul>
            </div>
        
            <style jsx> {`
            .container{
                border: 1px solid red;
                background-color: gray;
                margin: 20px;
                display: grid;
                grid-template-columns: repeat(auto-fill, minmax(720px, 2fr));
            }
            .datos{
                padding: 20px;
                width: auto;
                text-align: center;
                border: 1px solid black;
            }
            .datos ul{
                list-style-type: none;
                margin: 0;
                padding: 0;
            }
            .image{
                display: block;
                margin-left: auto;
                margin-right: auto;
                width: 25%;
            }
            @media (min-width: 720px) {
                image {
                display: block;
                width: 50%;
                }
            }
            .image img{
                width: 250px;
                border-radius: 50%;  
                align-items: center;    
            }

            `}
            </style>
    </div>
);

export default PersonalData;
